import React, { Component } from 'react';
import './App.css';
import Events from './components/Events';
import NaviBar from './components/NaviBar';

class App extends Component {
  render() {
    return (
      <div>
        <NaviBar/>
        <div className = "events_wrap">
      	  <Events/>
        </div>
      </div>

    );
  }
}

export default App;
